import React  from 'react';

class Login extends React.Component {
  render() {
    return(
      <form>
        <label htmlFor="email">
          e-mail
          <input type="email" id="email" />
        </label>
        <label htmlFor="senha">
          senha
          <input type="" id="senha" />
        </label>
      </form>
    );
  }
}

export default Login;
